import React from 'react';
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { deleteReparti } from '../../actions/RepartiActions';

function Reparti({reparti}) {
  
    const dispatch = useDispatch();

    const onDeleteRepartClik = (qytetId,spitaliId,repartiId) =>{
        dispatch(deleteReparti(qytetId,spitaliId,repartiId));
        window.location.reload();
    }


    return (
        <div className='container d-flex flex-row'>
            <div className='card card-body'>
                <div className='row'>
                    <div className='col-md-9'>
                        <div className='container'>
                            <h2>{reparti.name}</h2>
                        </div>
                    </div>
                    <div className='col-md-3'>
                        <ul className='list-group d-flex flex-column'> 
                            <Link to={`/employeeList/${reparti.id}`} className='list-group-item'>Qyteti board</Link>
                            <Link to={`/uptadeQytetiform/${reparti.id}`} className='list-group-item'>Update board</Link>
                            <Link to='' onClick={() => onDeleteRepartClik(qytetId,spitaliId,reparti.id)} className='list-group-item'>Delete board</Link>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Reparti;
